import React from 'react'

export default function RegisterPage() {
  return (
    <div className='RegisterPageGridLayout'>
        <RegisterPageGridLeftComponent/>
        <RegisterPageGridRightComponent/>
    </div>
  )
}

function RegisterPageGridLeftComponent()
{
    return(
        <div className='RegisterPageGridLeftComponentLayout'>
            <div className='MessegeCardLayout'>
                <h1 style={{fontSize : '90px'}}>WillToWheel</h1>
                <p style={{fontSize: '30px'}}>Where your demand meets our supply</p>

                <div style = {{marginTop: '60px' ,display : 'flex',flexDirection: 'row'}}>
                    <text style={{fontSize: '20px', alignSelf: 'center'}}>Not registered yet?</text>

                    <button className='LoginButtonLayout'>
                        <text>Register Now</text>
                    </button>
                </div>
            </div>
        </div>
    )
}

function RegisterPageGridRightComponent()
{
    return(
        <div className='RegisterPageGridRightComponentLayout'>
            <div className='LoginCardLayout'>
                <h1 style={{marginLeft: '200px'}}>Login</h1>

                <p>Enter your username</p>
                <input className='UsernameBoxLayout' type='text' placeholder='Username'></input>

                <p>Enter your password</p>
                <input className='PasswordBoxLayout' type= 'password' placeholder='Password'></input>


                <button className='SignInButtonLayout'>Sign In</button>


            </div>
        </div>
    )
}
